onClipEvent(enterFrame){
   if(Key.isDown(_parent._parent.上键) || Key.isDown(_parent._parent.下键) || Key.isDown(_parent._parent.左键) || Key.isDown(_parent._parent.右键))
   {
      _parent.攻击时可斜向改变移动方向(80);
   }
   else
   {
      _parent.攻击时可斜向改变移动方向2(45,1);
   }
}

onClipEvent(enterFrame){
   if(Key.isDown(_parent._parent.上键) || Key.isDown(_parent._parent.下键) || Key.isDown(_parent._parent.左键) || Key.isDown(_parent._parent.右键))
   {
      _parent.攻击时可斜向改变移动方向(70);
   }
   else
   {
      _parent.攻击时可斜向改变移动方向2(90,-1);
   }
}

